import React from 'react';
import LoadPage from './views/LoadPage';
import Header from './components/layout/Header';
import Logo from './components/Logo'
import Sand from './assets/vehicles/sandcrawler.png'


function App() {
  return (
    <div className="h-96 
                    rounded-lg
                    shadow-xl
                    w-72 
    " >
      <div className="rounded-t-lg max-h-54 overflow-hidden">
        <img src={Sand} alt=""/>
      </div>
        <div className="flex justify-center w-full py-6">
          <div className="space-y-2 text-center">
            <p className="text-lg text-blue-600">
              Sand Crawler
            </p>
              <p className="text-3xl text-green600">
                C$140000
              </p>
          </div>
        </div>
    </div>
  );
}

export default App;
